import React, { Component } from "react";
class PhotoLibrary extends Component {
  state = {
    key: "fda8922284b87b4f38775239ea65f173",
    secret: "60f4b8039d57b683",
    photos: []
  };
  componentDidMount() {
    fetch(
      "https://www.flickr.com/services/rest/?method=flickr.galleries.getPhotos&api_key=fda8922284b87b4f38775239ea65f173&gallery_id=66911286-72157647277042064&format=json&nojsoncallback=1"
    )
      .then(data => data.json())
      .then(data => {
        //console.log(data.photos.photo);

        let displayHtml = data.photos.photo.map(obj => {
          const imageUrl =
            "https://farm" +
            obj.farm +
            ".staticflickr.com/" +
            obj.server +
            "/" +
            obj.id +
            "_" +
            obj.secret +
            ".jpg";
          //console.log(imageUrl);
          return <img key={obj.id} src={imageUrl} alt="" />;
        });
        console.log(displayHtml);
        this.setState({ photos: displayHtml });
        console.log(this.state.photos);
      });
  }
  render() {
    return (
      <div
        id="carouselExampleIndicators"
        className="carousel slide"
        data-ride="carousel"
      >
        <ol className="carousel-indicators">
          <li
            data-target="#carouselExampleIndicators"
            data-slide-to="0"
            className="active"
          ></li>
          <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
          <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
        </ol>
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img className="d-block w-100" src="" alt="First slide" />
          </div>
          <div className="carousel-item active">
            <img className="d-block w-100" src="" alt="Second slide" />
          </div>
          <div className="carousel-item active">
            <img className="d-block w-100" src="" alt="Third slide" />
          </div>
        </div>
      </div>
    );
  }
}

//https://farm9.staticflickr.com/8187/8432423659_dd1b834ec5.jpg
//https://farm{farm-id}.staticflickr.com/{server-id}/{id}_{secret}.jpg

export default PhotoLibrary;
